            <div className="col">
                <img src={logo} alt="" />
                <div className="text">
                <h4>יציר קשר</h4>
                <p><strong> כתובת: </strong> סולטאני, קפר קאסם</p>
                <p><strong> טלפון: </strong>0543395113</p>
                <p><strong> שעות פתיחה: </strong>11:00 - 23:00</p>
                </div>
            </div>

        </div>
    );
};

export default Footer;
